import axios from "axios";
const api_url = "http://localhost:5000/api";

export { postLitter };

function postLitter(litter, id = null) {
  axios
    .get(`${api_url}/litter/${id}`)
    .then((res) => console.log(res).catch((err) => console.log(err)));
